function ExpenseDate(props) {

    const month = props.toLocaleString('en-US',{month: 'long'} );
    const year = props.toLocaleString('en-US',{year: '2-digit'} );
    const day = props.getFullYear();

    return(
        <div>
        <div> {month} </div>
        <div> {year} </div>
        <div> {day} </div>
      </div>
    );


}

export default ExpenseDate;
